import React from 'react';
import ReactDOM from 'react-dom';
import {
	BrowserRouter,
  	Route,
  	Link,
 	NavLink,
 	Switch
} from 'react-router-dom';

import Upload from './components/upload';
import MissingEntry from './components/missingEntry';
import MoreInfo from './components/moreinfo';

import './assets/styles/app.css';




class App extends React.Component{

	constructor(props){
		super(props);

	}


render(){
	return(

		<div>
				<h1> Missing persons portal</h1>


          		<Link to={`/home/MissingEntry`} className="link">Missing person</Link>
          		<Link to={`/home/Upload`} className="link">Upload information</Link>
          		<Link to={'/home/MoreInfo'}className="link">Additional resources</Link>


          	 <div className="tabs">



          	 </div>

		</div>



		)
	}


}



export default App;
